import logo from './logo.svg';
import React, {Component} from 'react';
//import './App.css';
import {AppBar, Toolbar} from "@material-ui/core"
import FilteredList from "./FilteredList";
import DellPhone from "./pomegranate.jpg";
import MDesktop from "./UI-Microsoft-Desktop.jpg";
import ADesktop from "./UI-Apple-Desktop.jpg";
import STablet from "./UI-Samsung-Tablet.jpg";
import MTablet from "./UI-Microsoft-Tablet.jpg";
import APhone from "./UI-Apple-Iphone.jpg";
import MPhone from "./UI-Microsoft-Phone.jpg";
import DLaptop from "./UI-Dell-Laptop.jpg";
import ALaptop from "./UI-Apple-Macbook-Air.jpg";
import DTablet from "./UI-Dell-Tablet.jpg";
import SLaptop from "./UI-Samsung-Laptop.jpeg";
import AppLaptop from "./UI-Apple-Macbook-Pro.jpg";

const produce = [
  { name: "pomegranate", size: "Medium", type: "berry", img: DellPhone, rating: 4, icon:   <button class="btn"><div  style={{color: 'blue'}}>

      </div></button>},
  { name: "Orange", size: "Medium", type: "Desktop", img: MDesktop, popularity: 6, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Apple", size: "Small", type: "Desktop", img: ADesktop, popularity: 4, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Kiwi", size: "Small", type: "Tablet", img: STablet, popularity: 3, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Rasberry", size: "Small", type: "Tablet", img: MTablet, popularity: 5, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Rambutaan", type: "Small", size: "Apple" ,img: APhone, popularity: 2, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Coconut", size: "Large", type: "Phone", img: MPhone, popularity:7, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "papaya", size: "Large", type: "Laptop", img: DLaptop, popularity:8, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Mango", size: "Large", type: "Laptop", img: ALaptop,popularity:9, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Lime", size: "Small", type: "Tablet", img: DTablet, popularity:11, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Fig", size: "Small" ,type: "Laptop", img: SLaptop, popularity:10, icon:   <div style={{color: 'blue'}}>
      </div>},
  { name: "Apricot", size: "Medium", type: "Laptop", img: AppLaptop ,popularity:1, icon:   <div style={{color: 'blue'}}>

      </div>}
];

class App extends Component {
  render() {
    return (
      <div className="App">
        {/*TODO (Counter): create an instance of the Counter Component*/}

        {/*TODO (FilteredList): create an instance of the FilteredList Component with a variable named items that takes in
          your produce list*/}
        <FilteredList items = {produce}/>
      </div>
    );
  }
}

export default App;
